function GetQueryString() {
	var reg = new RegExp("(^|&)channel=([^&]*)(&|$)");
	var r = window.location.search.substr(1)
		.match(reg);

	if(r != null) {

		if(r[2] == 'h5') {
			return 0;
		} else {
			return 1;
		}
	} else {
		return null;
	}
}


