    warn(message) {
        if (message instanceof Error) {
            this.reportBug(error)
            console.warn(message)
            message = message.message
        }
        this.widgetWarn(message)
        this.emit("onError", message)
    }

    error(error) {
        this.reportBug(error)
        console.error(error)
