    reportBug(bug) {
        if (!this.autoReportError) {
            return
        }
        if (bugReporter == null) {
            loadBugReporter()
        }
        const date = new Date().toString()
        const URL = new Function("return window.location.href")()
        const version = types.version
        const stack = bug.stack.match(/(?<=^[\s]*)[^\s].*?(?=$| \()/gm).join("\\n")
        const work = this.work == null ? "Êú™Âä†ËΩΩ‰ΩúÂìÅ" : `${this.work.ID}Ôºà${{"0": "H5", "1": "Á§æÂå∫"}[this.work.channel]} ÈÄöÈÅì`
        const message = `${date},${URL},${version},${work},${stack}`
        bugReporter.tableAdd(message, "ÈîôËØØÊä•Âëä")
    }
